function addDays(startDate, days) {
  const dateArray = [];
  for (let i = 0;i < days; i++) {
    const dateString = new Date(startDate.getTime() + i * 1 * 24 * 60 * 60 * 1000).toISOString().split("T")[0];
    dateArray.push(dateString);
    console.log(dateString);
  }
  return dateArray;
}
